import React from 'react';

import MenuItem from '../menu-item/menu-item.component';

import './directory.styles.scss';

class Directory extends React.Component {
    constructor(){
        super()
        this.state = {
            sections : [
                {
                    title: "HATS",
                    imageUrl: "https://images.unsplash.com/photo-1541233349642-6e425fe6190e?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=675&q=80",
                    id: 1
                },
                {
                    title: "Jackets",
                    imageUrl: "https://scontent.fdac64-1.fna.fbcdn.net/v/t1.0-9/69651316_2387691698016909_1263122355308199936_n.jpg?_nc_cat=108&_nc_oc=AQkPPtufhrNe-sGJqMXqLzNEBIoyQDzeVzyGOCKUexQR0Ab16XsLHTpOm-bMYRW-C1Q&_nc_ht=scontent.fdac64-1.fna&oh=cb8cd3756ecf0d37cfdc5fa052615b61&oe=5E2AD151",
                    id: 2
                },
                {
                    title: "Sneakers",
                    imageUrl: "data:image/jpeg;base64,",
                    id: 3
                },
                {
                    title: "Womens",
                    imageUrl: "https://scontent.fdac64-1.fna.fbcdn.net/v/t1.0-9/53311849_2265895356956152_3604012104383725568_n.jpg?_nc_cat=110&_nc_oc=AQnJ3X9tTCNMJvBsuTa3Aqe_vYVH-A8C8wnQWv3eUYm5_21Ebx7aGlTTInW4XhMZsx8&_nc_ht=scontent.fdac64-1.fna&oh=89c3a4fc747ea0bdbb1dfcef1ccaa8d4&oe=5E2888B0",
                    size: 'large',
                    id: 4
                },
                {
                    title: "Menz",
                    imageUrl: "https://scontent.fdac64-1.fna.fbcdn.net/v/t1.0-9/52717547_2063827597069989_7600779924101660672_n.jpg?_nc_cat=101&_nc_oc=AQlBPrjhj4v8x2ldHnYXJMNu9I7ngkXdVZEPF0n_aJDMGfz898pJhbANirLPWovNiGE&_nc_ht=scontent.fdac64-1.fna&oh=4cea7ef3942cde0829aa051b44d54373&oe=5E38573F",
                    size: 'large',
                    id: 5
                }
            ]
        }
    }

    render(){
        return (
            <div className= "directory-menu">
                {
                    this.state.sections.map(({title,imageUrl, id, size}) => (
                        <MenuItem key= {id} title={title} imageUrl= {imageUrl} size={size}/>
                    ))
                }
               
            </div>
        )
    }
    
    
}

export default Directory;
